var app = {
    // Application Constructor
    initialize: function () {
        this.bindEvents();
    },
    // Bind Event Listeners
    //
    // Bind any events that are required on startup. Common events are:
    // 'load', 'deviceready', 'offline', and 'online'.
    bindEvents: function () {
        if (window.cordova) {
            document.addEventListener('deviceready', this.onDeviceReady, false);
        } else {
            this.onDeviceReady();
        }
    },
    // deviceready Event Handler
    //
    // The scope of 'this' is the event. In order to call the 'receivedEvent'
    // function, we must explicity call 'app.receivedEvent(...);'
    onDeviceReady: function () {
        app.receivedEvent('deviceready');
    },
    // Update DOM on a Received Event
    receivedEvent: function (id) {
        $("#deviceready").html("Device Ready");

        console.log('Received Event: ' + id);
    }
};

function InitAddReportPage() {
    //this method will 1. reset the fields for a new report, and 2, capture the GPS coordinates and populate the form fields
    $("#LicensePlateState").val("");
    $("#LicensePlateNumber").val("");
    $("#UserId").val("1");
    $('#capturedPicture').attr('src', '');

    //
    if (window.cordova) {
        navigator.geolocation.getCurrentPosition(
            function (position) {
                $("#Latitude").val(position.coords.latitude).show();
                $("#Longitude").val(position.coords.longitude).show();
            },
            function (error) {
                console.log("Geolocation error: " + error.code + ": " + error.message);
            });

        $("#geoLocPanel").show();
        $("#photoPanel").show();
    }
    else {
        //try browser
        navigator.geolocation.getCurrentPosition(
            function (position) {
                $("#Latitude").val(position.coords.latitude).show();
                $("#Longitude").val(position.coords.longitude).show();
            },
            function (error) {
                console.log("Geolocation error: " + error.code + ": " + error.message);
                $("#Latitude").val(0);
                $("#Longitude").val(0);
            });

        //$("#geoLocPanel").hide();

        //$("#photoPanel").hide();
    }
}

function CapturePicture() {
    //from phonegap docs
    //http://docs.phonegap.com/en/edge/cordova_camera_camera.md.html#Camera

    var pictureSource;
    var destinationType;

    if (window.cordova) {

        pictureSource = navigator.camera.PictureSourceType;
        destinationType = navigator.camera.DestinationType;

        onPhotoDataSuccess = function (imageData) {
            //set image to DOM element
            $('#capturedPicture').attr('src', "data:image/jpeg;base64," + imageData).load();
        };

        onFail = function (error) {
            console.log("Camera error: " + error);
        };

        //get picture
        navigator.camera.getPicture(onPhotoDataSuccess, onFail, { quality: 50, allowEdit: true, destinationType: destinationType.DATA_URL });

    }
    else {
        var imageData = "data:image/jpeg;base64,";

        //set image to DOM element
        $('#capturedPicture').attr('src', imageData).load();
    }
}
